   return (
      <div className="sajdNavigacija">
         <div className="miniHeader"></div>
         <ul className="nav__links">
               <li><a href="#pocetak">O nama</a></li>
               <li><a href="#pocetak">Proizvodi</a></li>
               <li><a href="#pocetak">O kamenu</a></li>
               <li><a href="#pocetak">Kontakt</a></li>
         </ul>
         
      </div>
   )
}
